Este soneto pertenece a Francisco de Figueroa (1530-1588), poeta español del Siglo de Oro conocido también como "El Divino". Fue un representante destacado de la poesía renacentista española y contemporáneo de otros grandes poetas como Garcilaso de la Vega.
